let inputTest = "dabAcCaCBAcCcaDA";
let input = "";

function doReaction(input) {
    let foundReplacement = false;
    let newStr = input;

    do {
        foundReplacement = false;
        for (let i = 0; i < newStr.length-1; i++) {
            //Compare i and i+1
            // Different will be 32 if they're the matching upper/lower case
            if (Math.abs(newStr[i].charCodeAt() - newStr[i+1].charCodeAt()) === 32) {
                newStr = newStr.slice(0, i) + newStr.slice(i+2);
                i--;    // start the next window at the same place
                foundReplacement = true;
            }
        }

    } while (foundReplacement);

    return newStr;
};

// Part 1
let start = new Date().getTime();
let foundReplacement = false;
let newStr = doReaction(input);

console.log(newStr.length);
let end = new Date().getTime();
console.log(`Part 1 executed in ${end - start} ms`);

