// Part 2
let minLength = Number.MAX_SAFE_INTEGER;
start = new Date().getTime();

// Go through all letters, remove all, then polarize
for (let i = 65; i < 65+26; i++) {
    // Replace the uppercase character with empty string
    var regex = new RegExp(String.fromCharCode(i), "g");
    let curTry = input.replace(regex, "");

    // Replace the lowercase character with empty string
    regex = new RegExp(String.fromCharCode(i+32), "g");
    curTry = curTry.replace(regex, "");

    // Do the reaction
    curTry = doReaction(curTry);

    // Update if the new result is better
    if (curTry.length < minLength) {
        minLength = curTry.length;
    }
}

console.log(minLength);

end = new Date().getTime();
console.log(`Part 2 executed in ${end - start} ms`);